import styled from "styled-components";

const HomePage = styled.div`
  display: grid;
  grid-template-columns: 18% 82%;
  min-height: 41.09rem;
`;

const MainContainer = styled.div`
  background: linear-gradient(#663300, #996633, #999966);
  overflow-y: auto;
`;

export { HomePage, MainContainer };
